import React from "react";
import { Link } from "react-router-dom";

const Welcome = () => {
    console.log("✅ Welcome Page Loaded");  // Debugging log

    return (
        <div className="flex flex-col items-center justify-center min-h-screen bg-blue-900 text-white">
            <h1 className="text-4xl font-bold">CampusConnect!</h1>
            <p className="text-lg mt-2">Find buildings and locations with ease.</p>

            {/* Search Bar */}
            <input
                type="text"
                placeholder="What are you looking for?..."
                className="mt-4 p-2 w-80 rounded-full text-black"
            />

            {/* Quick Navigation Buttons */}
            <div className="mt-4">
                <Link to="/building/library" className="bg-blue-500 px-4 py-2 rounded m-2">Library</Link>
                <Link to="/building/gymnasium" className="bg-yellow-500 px-4 py-2 rounded m-2">Gymnasium</Link>
            </div>
        </div>
    );
};

export default Welcome;
